I'm trying to make it so that the code only runs once every .6 seconds. I'm using react and gsap. I've tried using useEffect with a dependency of cursor.cursorImage but it doesn't seem to work as intended. The code runs multiple times instead of once every .6 seconds.

To achieve this, you can use a state variable to keep track of the time since the last execution and compare it with the current time before running the effect. Here's an example of how you can modify your code:

```jsx
import { useRef, useState } from 'react';
import gsap from 'gsap';

function YourComponent() {
  const [lastExecutionTime, setLastExecutionTime] = useState(Date.now());
  const portfolioCurrentRef = useRef(null);
  const portfolioNextRef = useRef(null);
  const cursor = { cursorImage: 'url(...)' }; // assuming this is defined somewhere

  useEffect(() => {
    const currentTime = Date.now();
    const timeSinceLastExecution = currentTime - lastExecutionTime;

    if (timeSinceLastExecution >= 600) { // 600ms = .6s
      setLastExecutionTime(currentTime);

      const tl = gsap.timeline();

      tl.set(portfolioNextRef.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
      });
      tl.set(portfolioNextRef.current, {
        css: { backgroundImage: `url(${cursor.cursorImage})` },
      });

      tl.to(portfolioCurrentRef.current, {
        clipPath: 'polygon(20% 50%, 80% 50%, 80% 50%, 20% 50%)',
        duration: .5,
      }, 'start');

      tl.to(portfolioNextRef.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
        delay: .1,
        duration: .5,
      }, 'start');

      tl.set(portfolioCurrentRef.current, {
        clipPath: 'polygon(0% 0%, 100% 0%, 100% 100%, 0% 100%)',
      });

      tl.set(portfolioCurrentRef.current, {
        css: { backgroundImage: `url(${cursor.cursorImage})` },
      });
    }
  }, [cursor.cursorImage, lastExecutionTime]);

  return (
    <div ref={portfolioCurrentRef}>
      {/* Your content here */}
    </div>
    <div ref={portfolioNextRef}>
      {/* Your content here */}
    </div>
  );
}

export default YourComponent;
```

This code uses a state variable `lastExecutionTime` to keep track of the time since the last execution. The effect is only run if the time since the last execution is greater than or equal to 600ms (.6s). The `lastExecutionTime` is updated after the effect is run, so the next time the effect runs, it will only do so if the current time is at least 600ms after the last execution.

